import React from "react";
import "./SignInForm.css";
import "react-bootstrap";
import { Container as div, Form } from "react-bootstrap";
import chatIcon from "../img/chat-app-icon.png";

const SignInForm = () => {
  return (
    <div className="center br4 ba b--black-10 mv4 mw6 shadow-5">
      <Form className="text-center">
      <legend className="f1 fw6 ph0 mh0">Sign In to Chat</legend>
        <img src={chatIcon} className="chatIcon" alt="chat-icon"></img>
        <h3>Sign in to Chat</h3>
        <input type="email" placeholder="Username"  />
      </Form>
    </div>
  );
};

export default SignInForm;
